import FileCloak from '../FileCloak.webp';
import './Login.css';

function Login() {
  return (
    <>
      <div class="login-container" id="loginForm">
        <div class="logo-container">
            <img src={FileCloak} className="HomePage-logo" alt="FileCloak" />
        </div>
        <form class="login-form">
            <div class="input-group">
                <input type="text" id="emailLogin" name="emailLogin" placeholder="Email" required></input>
                <i class="icon username-icon"></i> 
            </div>
            <div class="input-group">
                <input type="password" id="passwordLogin" name="passwordLogin" placeholder="Password" required></input>
                <i class="icon password-icon"></i> 
            </div>
            <button type="submit" class="button" value="Login">LOGIN</button>
            <button type="button" class="button signup-btn" onclick="toggleForms()">Signup</button>
        </form>
    </div>
    </>
  );
}

export default Login;
